def fetch_component_base_code(components):
    base_codes = {}
    for component in components:
        if component in ALL_COMPONENTS:
            base_codes[component] = ALL_COMPONENTS[component]
        else:
            raise ValueError(
                f"Component {component} not found in the predefined components list."
            )
    return base_codes


